import React from 'react';
import { Match} from "@reach/router";


const Question = (props) => (
  <Match path="/questions/:id">
    {props =>
      props.match ? (
        <div>Hot {props.match.item}</div>
      ) : (
        <div>Uncool</div>
      )
    }
  </Match>
)

export default Question;
